import { BrowserRouter, Routes, Route } from "react-router-dom";
import Site from './components/Site'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/xtrude" element={ <Site /> } />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
